let main = function ()
{
    let shouldRefresh = true;
    let setUpAutoRefresh = function ()
    {
        /*
         * @Author Caleb Warren (Walking_Library)
         * @Last Updated - Feb 16, 2021
         *
         * To Use this Script open the browser's console while on the Netsuite Dashboard Page
         * and paste it in and Enjoy.
         *
         * WARNING: Netsuite is liable to change and break this script.
         * SPECIAL NOTE: Testing and Design was done in FIREFOX, Using Firefox may resolve issues.
         *
         * Note: It will not auto re-add it's self so you have to do the above every time you leave the page
         *
         * Note: It Should Notify you with a sound and an alert if a new case has popped up
         *
         *
         * Process For Setting up the Auto Refresher CODE NOTES
         *
         * Grab the Cases Element
         * Get the Refresh Button
         * Start the Auto Refresh Process
         * Display the UI
         *
         * */
        console.log("Setting Up Auto Refresher");

        //Grab the Cases Element

        let casesDivSpecialIdentifier = '[data-portlet-id="-9029"]';

        let casesDivNodeList = document.querySelectorAll(casesDivSpecialIdentifier);


        let errorMessage = "Make sure you are on the Dashboard Page and have the Cases Tab as a Widget.\n" +
            "If you are on the Dashboard page with the Cases Tab present the Script may have Broke.\n" +
            "Sorry for the Inconvenience :(";

        if (casesDivNodeList.length > 1 || casesDivNodeList.length === 0)
        {
            console.error("Could not Find the Cases Div.\n" + errorMessage);

            return;
        }

        let caseDiv = casesDivNodeList.item(0);


        //Get the Refresh Button
        let refreshButtonPath = [0, 2, 2];
        let refreshButton = followChildPath(refreshButtonPath, caseDiv);


        if (refreshButton === undefined || refreshButton.title !== "Refresh")
        {
            console.error("Could not find the Refresh Button.\n" + errorMessage);
            return;
        }
        refreshButton.onclick = updateRefreshTime;

        // Start the Auto Refresh Process
        let refreshTimeMinutes = .15; // This is in Min
        //NOTE: you can change this to make it longer or faster refresh rates

        //We do math to figure out how many milliseconds the minutes are

        let miliSecondRefreshTime = refreshTimeMinutes * 60 * 1000;
        //60 seconds in a minute, and 1000 miliseconds in a second;


        //This function calls it's self and refreshCases Function every [Specified amount of time]
        let recursiveFunction = function ()
        {

            if (shouldRefresh)
            {

                refreshCases(refreshButton);
            }
            setTimeout(() =>
            {
                recursiveFunction();
            }, miliSecondRefreshTime);

        }

        //Display the UI
        displayAutoRefreshStatus();
        recursiveFunction();
        console.log("Auto Refresher Script Setup Successful");
    };

    let updateRefreshTime = function ()
    {
        let currentTime = new Date();
        let currentMinutes = "" + currentTime.getMinutes();
        currentMinutes = currentMinutes.length >= 2 ? currentMinutes : "0" + currentMinutes;
        let refreshTime = currentTime.getHours() + ":" + currentMinutes;
        //Print the Refresh time to the Console
        console.log("Refreshing Cases - " + refreshTime);

        //Update the Refresh time on the Refresh UI
        let lastRefreshDisplay = document.getElementById("lastRefresh");
        lastRefreshDisplay.innerText = "Last Refresh: " + refreshTime;
    }


    let followChildPath = function (childPathArray, elementToTraverse)
    {
        /* This Function takes a int array of the child placements and follows the
         * path down
         * Example: followChildPath([0, 1, 3], divElement)
         * This would return the Child of the Fourth Child of the Second Child of the First Child of the ElementToTraverse
         * Kinda not reliable and may need to change in the future as netsuite isn't my program.
         * Was the easiest way to grab the refresh div as they don't place a special id on it.
         * as of Feb 16, 2021
         *  */
        let currentElement = elementToTraverse;
        for (let i = 0; i < childPathArray.length; i++)
        {
            let childIndex = childPathArray[i];
            if (currentElement === undefined || currentElement.children.length <= childIndex)
            {
                throw new Error("Could not Follow Child Path: " + elementToTraverse);
            }
            currentElement = currentElement.children[childIndex];


        }
        return currentElement;
    };


    let previousAmountOfTickets = -1;
    let previousTicketString = "";

    let newCasesPresent = function ()
    {
        /* Process to See if new Cases Are Present
         * Get the Table and the Table Body holding the Cases
         * Check the contents of the Table for Additions
         *
         *  */

        //Get the Table and the Table Body holding the Cases
        let tableID = "neg9029__tab";
        let casesTable = document.getElementById(tableID);
        let tableBody = casesTable.children[1];


        //Check the contents of the Table for Additions
        //Note: The table body is never empty so we have to weed out the things that are always there
        //        the default table Childs are hrow_lstinlnneg9029 and <empty string> as of Feb 16, 2021
        let defaultTableBodyChildIDs = "hrow_lstinlnneg9029";
        let amountOfTickets = 0;
        let ticketString = "";
        for (let i = 0; i < tableBody.children.length; i++)
        {
            let currentChild = tableBody.children[i];
            if (currentChild.id !== undefined)
            {
                let currentTicketID = currentChild.id;
                if (defaultTableBodyChildIDs.indexOf(currentTicketID) < 0 && currentTicketID !== "")
                {
                    ticketString += currentChild.id;
                    amountOfTickets++;
                }
            }
        }

        //To avoid spaming the notification sound we only return true when the amount of tickets is greater than the previous amount
        //we still need to update the amount of tickets
        if (previousAmountOfTickets !== amountOfTickets)
        {

            if (previousAmountOfTickets < amountOfTickets)
            {
                previousAmountOfTickets = amountOfTickets;
                previousTicketString = ticketString;
                return true;
            }
            previousAmountOfTickets = amountOfTickets;

        }

        if (previousTicketString !== ticketString && amountOfTickets !== 0)
        {

            console.log("Previous Ticket String: " + previousTicketString);
            console.log("Current Ticket String: " + ticketString);
            previousTicketString = ticketString;
            return true;
        }
        previousTicketString = ticketString;

        return false;
    }


    let playSoundFunction = function ()
    {
        let audioCtx = new (window.AudioContext || window.webkitAudioContext)();
        let preSRc = "data:audio/wav;base64,";
        let base64Audio = "";
        let playsound = function (audioBuffer)
        {
            let source = audioCtx.createBufferSource();
            source.buffer = audioBuffer;
            source.connect(audioCtx.destination);
            source.loop = false;
            source.start();
        };
        audioCtx.decodeAudioData(base64ToArrayBuffer(base64Audio)).then(playsound);

    }

    function base64ToArrayBuffer(base64)
    {
        let binary_string = window.atob(base64);
        let len = binary_string.length;
        let bytes = new Uint8Array(len);
        for (let i = 0; i < len; i++)
        {
            bytes[i] = binary_string.charCodeAt(i);
        }
        return bytes.buffer;
    }

    let refreshCases = function (refreshButton)
    {
        eventFire(refreshButton, "click");

        let refreshWaitTime = 1500;
        setTimeout(() =>
        {
            if (newCasesPresent())
            {
                playSoundFunction();
            }
        }, refreshWaitTime);


    };


    let eventFire = function (element, eventType)
    {
        //This Function Simulates a Click on the Button
        if (element.fireEvent)
        {
            element.fireEvent('on' + eventType);
        }
        else
        {
            let evObj = document.createEvent('Events');
            evObj.initEvent(eventType, true, false);
            element.dispatchEvent(evObj);

        }
    };

    let displayAutoRefreshStatus = function ()
    {
        /* Process for Displaying the Refresh UI/Status
         * Create the container div to hold everything
         * Create the Toggle Button
         *
         *  */

        //Create the container div to hold everything
        let autoRefreshStatusDiv = document.createElement("div");
        //yuck css in js
        autoRefreshStatusDiv.innerHTML = "<h6>Auto Refresher " +
            "<input id='refresherToggleButton' value='ON' type='button'>" +
            "</input>" +
            "<h6 id='lastRefresh'>" +
            "</h6>" +
            "</h6>";

        autoRefreshStatusDiv.style = "" +
            " position: fixed;" +
            " bottom: 3px;" +
            " right: 100px;" +
            " background-color: green;" +
            " width:200px;" +
            " height:50px;";


        document.body.appendChild(autoRefreshStatusDiv);

        //Create the Toggle Button
        let refresherToggleButton = document.getElementById("refresherToggleButton");

        refresherToggleButton.onclick = function (event)
        {
            //Note: this code runs when the Toggle Button is clicked
            //Toggles the Refresher to off or on
            refresherToggleButton.value = shouldRefresh ? "OFF" : "ON";
            shouldRefresh = !shouldRefresh;
        }
    }

    setUpAutoRefresh();
};

main();
